import React from 'react'

const Header = () => {
    return (
        <div>
            <h1>Рекорд</h1>
            <h2>2000 очков</h2>
        </div>
    )
}

const SerchPanel = () => {
    return (
        <input type="text" placeholder="поиск среди игроков"/>
    )
}

export const NewReg = () => {
    return (
        <>
        <h1>Hello</h1>
        <Header/>
        <SerchPanel/>
        </>)
}
